	controller: {
		hide: function(){
			analytics.destroy();
		},
		switchChart: function(e,model){
			var type= e.currentTarget.value;
			
			if(type === "sends"){
				analytics.settings.chartName = "Compare By Sends";
				analytics.sendsChart();
			}else{
				analytics.settings.chartName = "Compare By Ratings";
				analytics.ratingsChart();
			}

		}
	}
